function dataVisibleRenderer(t,e,i){if(t==0){return'<div class="status-pill grey"  title="'+lang_invisible+'"  data-toggle="tooltip"></div>'}else{return'<div class="status-pill green" title="'+lang_visible+'" data-toggle="tooltip"></div>'}}function dataStatusRenderer(t,e,i){if(t==1){return'<div class="status-pill grey"  title="'+lang_inactive+'" data-toggle="tooltip"></div>'}else{return'<div class="status-pill green" title="'+lang_active+'"   data-toggle="tooltip"></div>'}}function centerRenderer(t,e,i){return'<div class="text-center" data-toggle="tooltip">'+t+"</div>"}function currencyRenderer(t,e,i){return'<div class="text-center" data-toggle="tooltip">R$ '+t+"</div>"}function dataDatetimeRenderer(t,e,i){var a=new Date(t*1e3);var r=a.getFullYear();var n=twoDigit(a.getMonth()+1);var l=twoDigit(a.getDate());var o=twoDigit(a.getHours());var s=twoDigit(a.getMinutes());return l+"/"+n+"/"+r+" "+o+":"+s}function twoDigit(t){if(t<10){return"0"+t}return t}function dataTrueFalseRenderer(t,e,i){if(t==0||t==false||t=="false"){return lang_no}else{return lang_yes}}